import React, { useState } from "react";
import style from "./style.module.scss";

interface PropTypes {
  name: string;
  price: number;
  oldPrice: number;
  redText: string;
  images: string[];
  isLike: boolean;
  isAdd: boolean;
}

const Cart: React.FC<PropTypes> = ({
  name,
  price,
  oldPrice,
  redText,
  images,
  isLike,
  isAdd,
}) => {
  const [firstImg, secondImg] = images;
  return (
    <div className={style.slider__cart}>
      <div className={style.slider__cartImgBlock}>
        <img
          className={style.slider__cartImgFirst}
          src={`${process.env.PUBLIC_URL}/img/carts/${firstImg}`}
        />

        <img
          className={style.slider__cartImgSecond}
          src={`${process.env.PUBLIC_URL}/img/carts/${secondImg}`}
        />
      </div>
      <h3 className={style.slider__cartTitle}>{name}</h3>
      <div className={style.slider__cartPrice}>
        <span className={style.slider__cartPriceCurrent}>{price}$</span>
        <span className={style.slider__cartPriceOld}>{oldPrice}$</span>
      </div>
      <button
        className={style.slider__cartButton}
        onClick={() => console.log("click add")}
      >
        Додати в кошик
      </button>
      <button
        className={
          isLike
            ? `${style.slider__cartLike} ${style.slider__cartLike_active}`
            : `${style.slider__cartLike}`
        }
        onClick={() => console.log("click like")}
      >
        <img src={`${process.env.PUBLIC_URL}/img/heart-svgrepo-com.svg`} />
      </button>
      <span className={style.slider__cartButtonRed}>{redText}</span>
    </div>
  );
};

export default Cart;
